import React from "react";
import ReactDom from "react-dom";

function App() {
  const now = new Date();
  const a = 10;
  const b = 20;
  console.log(now, a + b);

  return (
    <div>
      <p>Hello world, it is {now}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
    </div>
  );
}

export default App;
